1. Define context receivers: These are interfaces that will receive context values from the injection system. For example, you could define a context receiver for the current date or the user's name.
2. Implement context providers: These are classes that will provide the context values to the injection system. For example, you could implement a context provider for the current date or the user's name.
3. Register context receivers and providers: This involves registering the context receivers and providers with the injection system. This can be done in the application's main module or in a dedicated module.
4. Use context values: Once the context receivers and providers are registered, you can use the context values in your code. For example, you could use the current date to format a date string or the user's name to display their name on the screen.

Here's an example implementation:
```kotlin
class MyAppModule {
  private val contextProviders = arrayOf(
    ContextProvider("userName", User::class.java.name),
    ContextProvider("currentDate", Date::class.java.name)
  )

  fun provideContext(context: Context, contextName: String): Any? {
    for (provider in contextProviders) {
      if (contextName == provider.name) {
        return provider.value
      }
    }
    return null
  }

  // Register context receivers and providers
  fun onContextInitialized(context: Context) {
    val userName = provideContext(context, "userName") as? User
    val currentDate = provideContext(context, "currentDate") as? Date
    // Use context values in your code
  }
}
